  render() {
    return (
      <div  className="container">
        This is our news components.
        <div>

          <div className="row">
            <div className="col-md-4"><NewsItems /></div>
            <div className="col-md-4"><NewsItems /></div>
            <div className="col-md-4"><NewsItems /></div>
          </div>


        </div>
      </div>
    )
  }
}

export default News
